pub fn length_of_longest_substring(s: String) -> i32 {
    use std::collections::{HashMap, HashSet};
    use std::thread::current;
    let mut map = HashMap::new();
    let total_len = s.len();
    let bytes = s.as_bytes();
    let mut max_len: usize = 0;
    let mut current_target: usize = 0;
    for i in 0..total_len {
        println!("i:{:?}", i);
        if !map.contains_key(&bytes[i]) {
            map.insert(bytes[i], i);
            println!("current_target:{:?}", map);
            if i - current_target + 1 > max_len {
                max_len = i - current_target + 1;
            }
            println!("max_len:{:?}", max_len);

            // current_target += 1;
        } else {
            let location = map.get(&bytes[i]).unwrap();
            if current_target < *location + 1 {
                current_target = *location + 1;
            }
            println!("current_target:{:?}", current_target);
            map.remove(&bytes[i]);
            map.insert(bytes[i], i);
            println!("map:{:?}", map);

            if i - current_target + 1 > max_len {
                max_len = i - current_target + 1;
            }
            println!("max_len:{:?}", max_len);
        }
    }
    println!("final_max_len:{:?}", max_len);
    max_len as i32
}

